  [],\n\t\"revision_timestamp\": \"2015-09-26T22:25:37.152849\",\n\t\"name\": \"coral-bleaching-data-from-bleachwatch-in-the-florida-keys-national-marine-sanctuary-from-2014-0\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The initial onset of mass coral bleaching
  can vary among different species, geographic locations, types of reef zones and
  a fluctuation of severity, which makes it very difficult to predict where or when
  it will occur. The Florida Keys BleachWatch Program, modeled after Great Barrier
  Reefu00e2u0080u0099s BleachWatch, is a team of trained recreational, commercial
  and scientific divers who help monitor and report on conditions at the reefs. After
  each visit to the reef, the divers complete a data form, either printed or online,
  and send it to the BleachWatch coordinator. The divers are provided with an underwater
  wristband to use as a reference and a reminder key below and above the water. Information
  from NOAA's remote sensing and in-situ monitoring projects are reviewed routinely
  and summarized along with BleachWatch volunteer observations in the field to provide
  a comprehensive overview of current conditions throughout the Florida Keys National
  Marine Sanctuary. Florida Keys Coral Bleaching Current Condtions Reports include
  a summary of relevant weather information, NOAA Coral Bleaching \"HotSpot\" and
  \"Degree Heating Weeks\" analysis, and updated in-situ monitoring data, along with
  BleachWatch observer reports for each region during a given period.\",\n\t\"license_title\":
